const int maxn = 100000 + 100;
int n;
int sum[maxn];

int lowbit(int x) {
    return x & (-x);
}

void add(int idx, int x) {
    if (idx == 0) {
        return ;
    }
    while (idx <= n) {
        sum[idx] += x;
        idx += lowbit(idx);
    }
}

int query(int idx) {
    int ret = 0;
    while (idx != 0) {
        ret += sum[idx];
        idx -= lowbit(idx);
    }
    return ret;
}

void init(vector<int> &usageLimits) {
    memset(sum + 1, 0, sizeof(int) * n);
    add(1, usageLimits[0]);
    for (int i = 2; i <= n; ++i) {
        add(i, usageLimits[i - 1] - usageLimits[i - 2]);
    }
}

int findFirstNotZero() {
    int low = 0;
    int high = n + 1;
    int mid;
    while (high - low > 1) {
        mid = (high + low) >> 1;
        if (query(mid) > 0) {
            high = mid;
        } else {
            low = mid;
        }
    }
    return high;
}

int bsearch(int x) {
    int high = n + 1;
    int low = 0;
    int mid;
    while (high - low > 1) {
        mid = (high + low) >> 1;
        if (query(mid) >= x) {
            high = mid;
        } else {
            low = mid;
        }
    }
    return high;
}

class Solution {
public:
    int maxIncreasingGroups(vector<int>& usageLimits) {
        n = usageLimits.size();
        sort(usageLimits.begin(), usageLimits.end());
        init(usageLimits);
        // cout << "===" << endl;
        for (int i = 1; i <= n; ++i) {
            if (query(n - i + 1) == 0) {
                return i - 1;
            }
            // for (int j = 1; j <= n; ++j) {
            //     cout << query(j) << " ";
            // }
            // cout << endl;
            int now = query(n - i + 1);
            int nxt = bsearch(now + 1);
            int pre = bsearch(now);
            // cout << "i = " << i << " now = " << now << " nxt = " << nxt << " pre = " << pre << endl;
            int d = nxt - (n - i + 1);
            add(pre, -1);
            add(pre + d, 1);
            add(nxt, -1);
        }
        return n;
    }
};

