bool judge(int mid, vector<int> &usageLimits) {
    init(usageLimits);
    for (int i = mid; i >= 1; --i) {
        int idx = findFirstNotZero();
        // cout << "i = " << i << " idx = " << idx << endl;
        if (n - idx + 1 < i) {
            return false;
        }
        add(idx, -1);
        add(idx + i, 1);
    }
    return true;
}

class Solution {
public:
    int maxIncreasingGroups(vector<int>& usageLimits) {
        n = usageLimits.size();
        sort(usageLimits.begin(), usageLimits.end());
        int low = 1;
        int high = n + 1;
        int mid;
        // cout << "====" << endl;
        while (high - low > 1) {
            mid = (low + high) >> 1;
            if (judge(mid, usageLimits)) {
                low = mid;
            } else {
                high = mid;
            }
            // bool flag = judge(mid, usageLimits);
            // cout << "mid = " << mid << " judge = " << flag << endl;
        }
        return low;
    }
};

const int maxn = 100000 + 100;

struct SegmentTree {
    int mn[maxn << 2], lazy[maxn << 2];

    inline int lson(int rt) {
        return rt << 1;
    }

    inline int rson(int rt) {
        return rt << 1 | 1;
    }

    void pushUp(int rt) {
        mn[rt] = min(mn[lson(rt)], mn[rson(rt)]);
    }

    void pushDown(int rt, int len) {
        if (lazy[rt] == 0) {
            return ;
        }
        int l = lson(rt);
        int r = rson(rt);
        lazy[l] += lazy[rt];
        lazy[r] += lazy[rt];
        mn[l] += lazy[rt];
        mn[r] += lazy[rt];
        lazy[rt] = 0;
    }

    void build(int rt, int l, int r, vector<int> &nums) {
        lazy[rt] = 0;
        if(l == r) {
            mn[rt] = nums[l - 1];
            return ;
        }
        int m = (l + r) >> 1;
        build(lson(rt), l, m, nums);
        build(rson(rt), m + 1, r, nums);
        pushUp(rt);
    }

    void add(int rt, int l, int r, int L, int R, int x) {
        if(L <= l && r <= R) {
            lazy[rt] += x;
            mn[rt] += x;
            return ;
        }
        pushDown(rt, r - l + 1);
        int m = (l + r) >> 1;
        if(L <= m) {
            add(lson(rt), l, m, L, R, x);
        }
        if(m < R) {
            add(rson(rt), m + 1, r, L, R, x);
        }
        pushUp(rt);
    }

    int query(int rt, int l, int r, int L, int R) {
        if(L <= l && r <= R) {
            return mn[rt];
        }
        pushDown(rt, r - l + 1);
        int m = (l + r) >> 1;
        int ret = INT_MAX;
        if(L <= m) {
            ret = min(ret, query(lson(rt), l, m, L, R));
        }
        if(R > m) {
            ret = min(ret, query(rson(rt), m + 1, r, L, R));
        }
        return ret;
    }
} tree;

class Solution {
public:
    int maxIncreasingGroups(vector<int>& usageLimits) {
        int n = usageLimits.size();
        sort(usageLimits.begin(), usageLimits.end());
        tree.build(1, 1, n, usageLimits);
        int ans = 0;
        for (int i = 1; i <= n; ++i) {
            if (tree.query(1, 1, n, n - i + 1, n) >= 1) {
                tree.add(1, 1, n, n - i + 1, n, -1);
                ans = i;
            }
        }
        return ans;
    }
};

